import { faCloud } from '@fortawesome/free-solid-svg-icons';
import { faSun } from '@fortawesome/free-solid-svg-icons';


const iconPicker = (weatherId) => {
    if (weatherId < 300) {
        return faSun;
    }
    if (weatherId > 800) {
        return faCloud;
    }
}

export default iconPicker;
